import React from "react";
import wheel from "../Images/wheel.png";
import "../Components/LandingPage.css";

function ResultPage() {
  return (
    <div className="outer">
      <img className="wheel-img" src={wheel} alt="wheel" />
      <div>
        <form action="submit">
          <p>This is how EngageBud looks like in action!</p>
          <input className="inp" type="mail" placeholder="Email" />

          <input className="inp" type="number" placeholder="Number" />
          <div className="c-box">
            <label htmlFor="check">
              I agree to receiving recurring automated messages at the number I
              have provided. Consent is not a condition to purchase.
            </label>
          </div>
          <div className="progress">
            <div className="fill a"></div>
          </div>
          <button>Try your luck</button>
        </form>
      </div>
    </div>
  );
}

export default ResultPage;
